import React, {useState} from "react";
import { Carousel } from "react-bootstrap";

function ListingImageCarousel({ imgsrc }) {
  return (
    <Carousel.Item>
      <img className="d-block w-100" src={imgsrc} />
    </Carousel.Item>
  );
}

export default ListingImageCarousel;
